import React from "react";
import CartItems from "../Component/CartItems/CartItem";
import { ShopContext } from "../Context/ShopContext";

const Cart = () => {
  return (
    <div>
      <CartItems
        selectedFaceIndex={selectedFaceIndex}
        selectedStrapIndex={selectedStrapIndex}
      ></CartItems>
    </div>
  );
};

export default Cart;
